import React from 'react';
import YoutubePlayList from '../components/YoutubePlayList'
import VideoPlayer from '../components/VideoPlayer';
import CardSmall from '../components/CardSmall'
import Layout from '../components/Layout'
import Carousel from '../components/Carousel'

const Algae = () => {
    return (
        <Layout>
        <div>
            <section style={{
                width: "100%",
                height:"90vh",
                display:"flex",
                justifyContent:"center",
                backgroundColor: "blue",
            }}>
                <div style={{
                    height:"90vh",
                    width: "100%",

                }}>
                    <VideoPlayer />
                </div>
            </section>


            <section style={{
                width: "100%",
                height:"70vh",
                display:"flex",
                justifyContent:"center",
                backgroundColor: "gray",
            }}>
                <div style={{
                    height:"75vh",
                    width:"75 vh",
                }}>
                <CardSmall />
                </div>


            </section>
            <section style={{
                width: "100%",
                height:"90vh",
                display:"flex",
                justifyContent:"center",
                backgroundColor: "green",
            }}>
                <Carousel />
                < img src =" https://1.bp.blogspot.com/-MenSuQkFeaI/WVOUS0eMFmI/AAAAAAAAALA/JehplmYqjU0Yf8AeyiQMRGM-6aokgc_xgCLcBGAs/s1600/Fun%2Bfact%2Bdiatoms.png" />
                < img src =" https://study.com/cimages/videopreview/videopreview-full/supplemental-science-diatoms-definition-characterists-types_114610.jpg" />
                < img src ="https://cdn.britannica.com/40/12340-050-E09C431B/frustules-cell-walls-Diatoms-opaline-silica-pores.jpg " />
                < img src ="https://i.pinimg.com/564x/b1/75/98/b17598181da42d95a7a23fe4650fde46.jpg " />
                < img src =" https://i.pinimg.com/564x/af/3b/30/af3b3081a0625fd0dd45e4212a7db299.jpg" />
                < img src ="https://i.pinimg.com/564x/eb/0d/ca/eb0dcab495286e6d9629d2d8b5092523.jpg " />
                < img src =" https://i.pinimg.com/564x/5f/ea/7d/5fea7d35a9ab579eae659cb47568b4cd.jpg" />
            </section>
        </div>
        </Layout>
    );
};

export default Algae;
